const querystring = require('querystring')
const HiRobot = require('./robot')
const config = require("./config")

exports.handler = async (event, context) => {
    // HiÈ™åËØÅÂõûË∞ÉÊé•Âè£‰ΩøÁî®
    const queryStringBody = querystring.parse(event.body)
    if (queryStringBody['echostr']) {
        return {
            "isBase64Encoded": false,
            "statusCode": 200,
            "body": queryStringBody['echostr']
        }
    }

    // ÂàùÂßãÂåñÊú∫Âô®‰∫∫
    const robot = new HiRobot(config.OutEndpoint, config.Token, config.EncodingAESKey)

    // ‰º†ÂÖ• event.body Ëß£ÊûêÊé•Êî∂Âà∞ÁöÑÊ∂àÊÅØ
    const incoming = robot.receiveMessage(event.body)
    const caller = incoming.callerUserID
    const text = incoming.rawBody[1].content
    const command = incoming.rawBody[0].commandname
    const hand = text.toLowerCase()

    // ÊãºË£ÖËøîÂõûÁöÑÊ∂àÊÅØ
    let messageBody = [{
        "atuserids": [caller],
        "atall": false,
        "type": "AT"
    }, {
        content: text,
        type: "TEXT"
    }, {
        content: " üëàüèªËøô‰∏™ÂäüËÉΩRDËøòÂú®ÂºÄÂèë‰∏≠...,ÊèêÈÜí‰∏ã‰ªñÂêß",
        type: "TEXT"
    }]

    const isAndroid = hand.indexOf("android") != -1 || command === 'android';
    const isIos = hand.indexOf("ios") != -1 || command === 'ios';

    if (isAndroid) {
        messageBody = [{
            "atuserids": [caller],
            "atall": false,
            "type": "AT"
        }, {
            content: "xxxandroidÊúÄÊñ∞ÂåÖÂú∞ÂùÄ\n",
            type: "TEXT"
        }, {
            "href": "http://d.7short.com/bnz3",
            "type": "LINK"
        }]

    } else if (isIos) {
        messageBody = [{
            "atuserids": [caller],
            "atall": false,
            "type": "AT"
        }, {
            content: "iosÊúÄÊñ∞ÂåÖÂú∞ÂùÄ\n",
            type: "TEXT"
        }, {
            "href": "http://d.7short.com/zjp8",
            "type": "LINK"
        }]
    }
    // ÂèëÈÄÅÊ∂àÊÅØ
    try {
        await robot.sendMessage(incoming.groupID, messageBody)
        if (isAndroid) {
            await robot.sendMessage(incoming.groupID, messageBody = [{
                "content": "data:image/png;base64,",
                "type": "IMAGE"
            }])
        } else if (isIos) {
            await robot.sendMessage(incoming.groupID, messageBody = [{
                "content": "data:image/png;base64,",
                "type": "IMAGE"
            }])
        }
    } catch (error) {
        console.error(error)
        return {
            "isBase64Encoded": false,
            "statusCode": 500,
            "body": error.message
        }
    }

    return {
        "isBase64Encoded": false,
        "statusCode": 200,
        "body": "done"
    }

}